w.x:
var $bm_rt;
var s, L, w;
try {
    s = $bm_div($bm_transform.scale[0], 100);
    L = thisLayer;
    while (L.hasParent) {
        s *= $bm_div(L.parent.scale[0], 100);
        L = L.parent;
    }
    w = value;
    $bm_rt = $bm_div(w, s);
} catch (e) {
    $bm_rt = value;
}
;

